    const [category,setCategory] = useState(undefined);

    React.useEffect(() => {
        if(props.categoryState !== undefined) {
            setCategory(props.categoryState)
        }
        console.log(props.categoryState)
    }, [props.categoryState])

    return(
        {}
    )
}



export default UniqueCategoryComponents;
